                    <div className="row">
                        <div className="col">
                            <p className="h3 text-success fw-bold">Creat Contact</p>
                            <p className="fst-italic">loren30</p>
                        </div>
                    </div>
                </div>

            </section>
        </React.Fragment>
    )
};
export default AddContact;
